import React from 'react'
import { Allrestaurants } from '../../../interfaces/Restaurant'

export default function AllRestaurants() {
  return (
    <div>
        {Allrestaurants.map((restaurant)=>(
                   <div className=''> 
                    <img src={restaurant.PictureURL} alt=''/>
                    <p> {restaurant.name}</p>
                    <p>{restaurant.ChefName}</p>
                    </div>))}
    </div>
  )
}
<AllRestaurants/>
